        c = s[i]
        if c.isdigit():
            num = num * 10 + int(c)
        if c == '(':
            j = i
            count = 0
            while i < len(s):
                if s[i] == '(':
                    count += 1
                elif s[i] == ')':
                    count -= 1
                if count == 0:
                    break
                i += 1
            num = calculate(s[j + 1:i])
            i += 1
        if not c.isdigit() and c != ' ' and (c != '(') or i == len(s) - 1:
            if sign == '+':
                stack.append(num)
            if sign == '-':
                stack.append(-num)
            if sign == '*':
